"Staff","staff_th_full_name":"Full Name","staff_th_role":"Role","staff_th_user_name":"User Name","staff_user_name_description":"User name will be used for login. It cannot be changed afterwards","staff_user_name_exists":"Staff with user name already exists in this store","staff_user_name_exists_chain":"Staff with user name already exists in this chain","staff_user_name_invalid":"Invalid user name, valid characters are: A-Z a-z 0-9 . _","stock_unit":"Stock unit","stock_unit_delete_unit_confirm_text":"Are you sure to delete this stock unit?","stock_unit_delete_unit_confirm_title":"Delete Stock Unit","stock_unit_n_ingredients":"{0} Ingredient(s)","stock_unit_n_items":"{0} Item(s)","stock_unit_name":"Unit Name","stock_unit_new":"New Unit","stock_unit_unable_to_delete_description":"There are {0} linked to this unit. Please reassign linked items / ingredients first.","stock_unit_unable_to_delete_title":"Unable to Delete Unit","subscription_activated_branch":"{0} Cabang yang Aktif","subscription_branches":"Cabang","subscription_button_contact_us":"Contact Us","subscription_button_free_trial":"6 Bulan Gratis Trial","subscription_button_upgrade":"Upgrade","subscription_cancel_current_payment":"Anda akan kehilangan pembayaran tertunda yang ada saat ini. Anda yakin untuk lanjut?","subscription_current_plan":"Plan Saat Ini","subscription_expire_date":"Tanggal Masa Berlaku","subscription_expire_on":"Masa berlaku habis pada {0}","subscription_extend_note":"Untuk memperpanjang plan, jumlah cabang harus sama dengan plan saat ini. Jika anda ingin menambah cabang, silahkan menambah setelah perpanjangan plan. Jika anda ingin mengurangi jumlah cabang, harap hubungi customer service kami.","subscription_faq_answer_1":"Premium subscription mendukung chain store management, fitur membership dan premium fitur lain yang akan datang di pipeline.","subscription_faq_answer_10":"Masuk di Ocha Saya dengan mudah. Di Halaman Upgrade, anda bisa tekan tombol \'Perpanjang Plan Saya\' untuk perpanjang. Anda harus membeli Jumlah Cabang yang sama dengan plan anda saat ini.","subscription_faq_answer_11":"Ya, anda harus menghubungi kami, berikan nama toko yang anda ingin matikan.","subscription_faq_answer_12":"Tidak, cabang akan tetap muncul di Daftar Cabang. Tetapi, anda tidak bisa menggunakan cabang kecuali diaktifkan kembali","subscription_faq_answer_13":"Selama quota anda di plan anda sekarang lebih dari toko aktif saat ini, anda bisa mengaktifkan ulang toko yang di matikan.","subscription_faq_answer_14":"Anda hanya bisa membatalkan subscription yang belum dibayar. Jika pembayaran sudah di proses, anda tidak akan bisa membatalkan pembayaran atau mendapat refund.","subscription_faq_answer_15":"Tidak","subscription_faq_answer_16":"Untuk pembayaran premium, periode anda akan otomatis dimulai setelah pembayaran disetujui.","subscription_faq_answer_17":"Anda hanya bisa mengakses cabang utama, semua fitur premium akan dimatikan.","subscription_faq_answer_18":"Sampai dengan 5000 pengguna.","subscription_faq_answer_19":"Anda bisa menambah anggota, mengubah konversi poin dan anggota bisa menggunakan poin untuk penukaran barang.","subscription_faq_answer_2":"Jika anda ingin menambah cabang yang melebihi plan anda, anda harus membuat pembayaran tambahan. Tanggal masa berlaku dari cabang baru akan sama dengan plan anda saat ini. Biaya tambahan juga akan prorata.","subscription_faq_answer_20":"Ya, anda bisa menghubungi kami untuk bulk import (di pipeline).","subscription_faq_answer_21":"Ya. Anda bisa melihat laporan keanggotaan melalui web portal.","subscription_faq_answer_3":"Anda harus membayara paling tidak jumlah cabang yang ada di aplikasi anda. Jika anda ingin memilih beberapa cabang tertentu, anda harus mematikan cabang lain di aplikasi anda terlebih dahulu.","subscription_faq_answer_4":"Ya, kita menawarkan free 6 bulan trial.","subscription_faq_answer_5":"Fitur sama, kecuali anda hanya bisa membuat 5 cabang paling banyak untuk free trial.","subscription_faq_answer_6"